import React, { useEffect, useCallback } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { useGoogleMap } from "../hooks/useGoogleMaps.js";
import "./RestaurantResults.css";

const RestaurantResults = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const searchLocation = location.state?.searchLocation;
    const { restaurants, loading, error, initMap } = useGoogleMap(searchLocation);

    const loadMapWithRetry = useCallback(async () => {
        const MAX_RETRIES = 5;
        const RETRY_INTERVAL = 1000;
        let retryCount = 0;

        const attemptLoad = async () => {
            try {
                if (!window.google || !window.google.maps || !window.google.maps.places) {
                    if (retryCount < MAX_RETRIES) {
                        retryCount++;
                        await new Promise(resolve => setTimeout(resolve, RETRY_INTERVAL));
                        return attemptLoad();
                    }
                    throw new Error("Failed to load Google Maps API");
                }
                await initMap();
            } catch (err) {
                console.error("Error in map loading:", err);
                throw err;
            }
        };

        return attemptLoad();
    }, [initMap]);

    useEffect(() => {
        if (!searchLocation) {
            navigate("/");
            return;
        }

        let isSubscribed = true;

        const loadMap = async () => {
            try {
                await loadMapWithRetry();
            } catch (err) {
                console.error("Error loading map:", err);
            }
        };

        loadMap();

        return () => {
            isSubscribed = false;
        };
    }, [searchLocation, navigate, loadMapWithRetry]);

    return (
        <div className="results-page">
            <div className="results-header">
                <button onClick={() => navigate("/")} className="back-button">
                    <i className="fas fa-arrow-left"></i> Back to Search
                </button>
                <h1>Restaurants near {searchLocation?.address || "the selected location"}</h1>
            </div>

            <div className="results-container">
                <div id="map" className="map-container"></div>

                <div className="restaurants-list">
                    {loading && <div className="loading">Searching for restaurants...</div>}
                    {error && (
                        <div className="error-message">
                            {error}
                            <button
                                onClick={() => loadMapWithRetry()}
                                className="retry-button"
                            >
                                Retry
                            </button>
                        </div>
                    )}

                    {!loading &&
                        !error &&
                        restaurants.map((restaurant) => (
                            <div key={restaurant.place_id} className="restaurant-card">
                                {restaurant.photos?.[0] && (
                                    <img
                                        src={restaurant.photos[0].getUrl()}
                                        alt={restaurant.name}
                                        className="restaurant-image"
                                    />
                                )}
                                <div className="restaurant-info">
                                    <h3>{restaurant.name}</h3>
                                    <p>{restaurant.vicinity}</p>
                                    <div className="restaurant-details">
                                        <span className="rating">
                                            {restaurant.rating
                                                ? `${restaurant.rating} ⭐`
                                                : "No rating"}
                                        </span>
                                        {restaurant.price_level && (
                                            <span className="price-level">
                                                {"$".repeat(restaurant.price_level)}
                                            </span>
                                        )}
                                    </div>
                                    {restaurant.opening_hours && (
                                        <p className={`status ${restaurant.opening_hours.isOpen
                                            ? restaurant.opening_hours.isOpen()
                                                ? "open"
                                                : "closed"
                                            : "unknown"
                                            }`}>
                                            {restaurant.opening_hours.isOpen
                                                ? restaurant.opening_hours.isOpen()
                                                    ? "Open Now"
                                                    : "Closed"
                                                : "No Opening Information"}
                                        </p>
                                    )}
                                </div>
                            </div>
                        ))}
                </div>
            </div>
        </div>
    );
};

export default RestaurantResults;
